let arr = [
  'ChartApp',
  'ChartApp2'
]
class chartApp extends Component {
  status = {
    enable: false
  };
  stateClick = (event) => {
    this.setState({enable:!this.state.enable})
  }
  render() {
    return (
      <div>
        {/* <h1>ChartApp</h1> */}
        {/* <p>{this.state.enable}</p> */}
        {
          arr.map(v => {
            return <h1 key={v} onClick={this.stateClick()}>{v}</h1> 
          })
        }
      </div>
    );
  }
}

export default chartApp;
